import React, { useEffect, useRef } from 'react';
import { load } from '@2gis/mapgl';

const MapComponent = () => {
  load().then((mapgl) => {
    const map = new mapgl.Map('container', {
        center: [55.31878, 25.23584],
        zoom: 13,
        key: '8f104049-075f-4c47-817b-b8b450854d86',
    });
});
};

export default MapComponent;
